"use strict";

window.jsPDF = window.jspdf.jsPDF;

const doc = new jsPDF();
let globalHeight = 25;
const padding = 15;

//TODO add parameters
export function createAndDownloadPdf(
  kind_voornaam,
  kind_achternaam,
  kind_geboorte_dag,
  kind_geboorte_maand,
  kind_geboorte_jaar,
  kind_geslacht,
  kind_prematuur,
  kind_geboorte_plaats,
  kind_rijksregisternummer,
  kind_gesproken_thuistaal,
  nood_voornaam,
  nood_achternaam,
  nood_verwandschap,
  nood_telefoon,
  afhaler_1_voornaam,
  afhaler_1_achternaam,
  afhaler_1_verwandschap,
  afhaler_1_telefoon,
  afhaler_2_voornaam,
  afhaler_2_achternaam,
  afhaler_2_verwandschap,
  afhaler_2_telefoon,
  afhaler_3_voornaam,
  afhaler_3_achternaam,
  afhaler_3_verwandschap,
  afhaler_3_telefoon,
  afhaler_niet,
  huisarts_naam,
  huisarts_adres,
  huisarts_telefoon,
  medicatie_1_naam,
  medicatie_1_schema,
  medicatie_2_naam,
  medicatie_2_schema,
  allergie_naam,
  allergie_behandeling,
  kinderziektes,
  speciale_zorg,
  koortswerende_middelen,
  bijzonderheden_gezin,
  slapen_knuffel,
  slapen_fopspeen,
  slapen_zij,
  slapen_buik,
  slapen_rug,
  slapen_opletten,
  troosten_hoe,
  troosten_woorden,
  troosten_wanneer,
  opmerking,
  op_stap,
  vervoer,
  beeldmateriaal_intern,
  beeldmateriaal_extern,
  iban,
  bic
) {
  // Add helan logo

  doc.addImage(imgdata, "PNG", 155, 5, 50, 25);

  // Add Inlichtingenfiche title
  doc.setFontSize(30);
  doc.text(`Inlichtingenfiche`, 5, 25);

  doc.setFontSize(10);
  // Identificatie kind
  deel(
    "Gegevens kind",
    [
      "Voornaam:",
      "Achternaam:",
      "Geboortedatum:",
      "Geslacht:",
      "Prematuur geboren:",
      "Geboorteplaats:",
      "Rijksregisternummer:",
      "Gesproken thuistaal:",
    ],
    [
      kind_voornaam,
      kind_achternaam,
      [kind_geboorte_dag, kind_geboorte_maand, kind_geboorte_jaar].join("/"),
      kind_geslacht,
      kind_prematuur,
      kind_geboorte_plaats,
      kind_rijksregisternummer,
      kind_gesproken_thuistaal,
    ],
    globalHeight + 15,
    6,
    8,
    10,
    80,
    5
  );

  deel(
    "Nood contact",
    ["Voornaam:", "Achternaam:", "Verwandschap:", "Telefoon:"],
    [nood_voornaam, nood_achternaam, nood_verwandschap, nood_telefoon],
    globalHeight + padding,
    6,
    8,
    10,
    80,
    5
  );

  deel(
    "Afhalers",
    [
      "Voornaam 1:",
      "Achternaam 1:",
      "Verwandschap 1:",
      "Telefoon 1:",
      "Voornaam 2:",
      "Achternaam 2:",
      "Verwandschap 2:",
      "Telefoon 2:",
      "Voornaam 3:",
      "Achternaam 3:",
      "Verwandschap 3:",
      "Telefoon 3:",
      "Niet ophalen:",
    ],
    [
      afhaler_1_voornaam,
      afhaler_1_achternaam,
      afhaler_1_verwandschap,
      afhaler_1_telefoon,
      afhaler_2_voornaam,
      afhaler_2_achternaam,
      afhaler_2_verwandschap,
      afhaler_2_telefoon,
      afhaler_3_voornaam,
      afhaler_3_achternaam,
      afhaler_3_verwandschap,
      afhaler_3_telefoon,
      afhaler_niet,
    ],
    globalHeight + padding,
    6,
    8,
    10,
    80,
    5
  );

  deel(
    "Medisch",
    [
      "Naam huisarts/kinders:",
      "Adres:",
      "Telefoon:",
      "Medicatie 1:",
      "Schema 1:",
      "Medicatie 2:",
      "Schema 2:",
      "Allergie:",
      "Behandeling:",
      "Kinderziektes:",
      "Speciale zorg:",
      "Koortswerend middel:",
      "Bijzonderheden gezin:",
    ],
    [
      huisarts_naam,
      huisarts_adres,
      huisarts_telefoon,
      medicatie_1_naam,
      medicatie_1_schema,
      medicatie_2_naam,
      medicatie_2_schema,
      allergie_naam,
      allergie_behandeling,
      kinderziektes,
      speciale_zorg,
      koortswerende_middelen,
      bijzonderheden_gezin,
    ],
    globalHeight + padding,
    6,
    8,
    10,
    80,
    5
  );

  deel(
    "Slapen",
    [
      "Slapen met knuffel:",
      "Slapen met fopspeen:",
      "Zij:",
      "Buik:",
      "Rug:",
      "Opletten slaap:",
    ],
    [
      slapen_knuffel,
      slapen_fopspeen,
      slapen_zij,
      slapen_buik,
      slapen_rug,
      slapen_opletten,
    ],
    globalHeight + padding,
    6,
    8,
    10,
    80,
    5
  );

  deel(
    "Troosten",
    ["Hoe:", "Woorden:", "Wanneer:"],
    [troosten_hoe, troosten_woorden, troosten_wanneer],
    globalHeight + padding,
    6,
    8,
    10,
    80,
    5
  );

  deel(
    "Opmerkingen",
    ["Opmerkingen:", "Op stap:", "Vervoer:"],
    [opmerking, op_stap, vervoer],
    globalHeight + padding,
    6,
    8,
    10,
    80,
    5
  );

  deel(
    "Beeldmateriaal",
    ["Intern:", "Extern:"],
    [beeldmateriaal_intern, beeldmateriaal_extern],
    globalHeight + padding,
    6,
    8,
    10,
    80,
    5
  );

  deel(
    "Betaling",
    ["IBAN:", "BIC:"],
    [iban, bic],
    globalHeight + padding,
    6,
    8,
    10,
    80,
    5
  );

  addHandtekening();
  doc.save(`Inlichtingenfiche ${kind_voornaam} ${kind_achternaam}.pdf`);
}

function addHandtekening() {
  var datapair = $("#signature").jSignature("getData", "image");

  let height = globalHeight + padding;
  if (height >= doc.internal.pageSize.height - padding) {
    doc.addPage();
    height = padding;
  }
  doc.setTextColor(19, 30, 85);
  doc.text("Handtekening", 5, height);
  doc.setTextColor(0);

  height += 8;

  doc.addImage(
    "data:" + datapair[0] + "," + datapair[1],
    "PNG",
    5,
    height,
    100,
    25
  );

  globalHeight = height;
}

function deel(
  title,
  keyset,
  valueset,
  startHeight,
  lineHeight,
  titleHeight,
  keyMargin,
  valueMargin,
  titleMargin
) {
  let height = startHeight;

  doc.setTextColor(19, 30, 85);
  doc.text(title, titleMargin, height);
  doc.setTextColor(0);

  height += titleHeight;

  for (let i = 0; i < keyset.length; i++) {
    if (height >= doc.internal.pageSize.height - padding) {
      doc.addPage();
      height = padding;
    }

    const key = keyset[i];
    const value = doc.splitTextToSize(valueset[i], 120);
    doc.text(key, keyMargin, height);
    doc.text(value, valueMargin, height);
    height += lineHeight * value.length;
  }

  globalHeight = height;
}

const imgdata =
  "data:image/png;base64,";
